#include<bits/stdc++.h>
using namespace std;
#define ll long long
ll l,r,k;
int main()
{
    cin>>l>>r>>k;
    ll ans=0;
    for(ll i=l;i<=r;i++)
    {
        string s=to_string(i);
        int cnt=0;
        for(int j=0;j<s.size();j++)
        {
            for(int l=0;l<s.size();l++)
            {
                if(s[j]==s[l])
                {
                    cnt++;
                }
            }
        }
        if(cnt<=k)
        {
            ans+=i;
        }
    }
    cout<<ans%998244353;
    return 0;
}
